// Footer.js
import './footer.css';
import backgroundImage from '../pic/background.png'
import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <div className='background'>
        <div className='formlink'>
            <Link to='https://www.facebook.com/'>Say Hello</Link>
        </div>
    </div>
  );
};

export default Footer;
